lic authority","planning-permission-status":"permissioned","planning-permission-type":"full planning permission","hazardous-substances":"","latitude":"50.843851","longitude":"0.433241","hectares":"0.07","minimum-net-dwellings":"8","maximum-net-dwellings":"8","start-date":"2017-10-01","end-date":"","notes":"\"RR/2016/3254/P - Demolition of existing building. Erection of ground floor retail comprising 3 shops and first & second floor residential as 9 no. flats and onsite car parking. Three A1 units at ground floor. Approximately 170 sqm (gross).\"","resource":"971945b888f0a1073af5a74b9226d865fa156e338ab1dc28c6a69bf9a2e79619"},{"entry-date":"2019-10-01","organisation":"local-authority-eng:ROH","site":"RDCBLR0013","site-address":"17 & 17A Dorset Road South, Bexhill","site-plan-url":"https://www.rother.gov.uk/CHttpHandler.ashx?id=32756","deliverable":"yes","ownership":"not owned by a public authority","planning-permission-status":"permissioned","planning-permission-type":"full planning permission","hazardous-substances":"","latitude":"50.841034","longitude":"0.482826","hectares":"0.07","minimum-net-dwellings":"4","maximum-net-dwellings":"5","start-date":"2017-10-01","end-date":"","notes":"\"This brownfield site is part of a larger site that includes greenfield land. RR/2016/569/P - Demolition of existing buildings and erection of a building comprising 12 apartments and an open sided garage block for 4 cars (resubmission of planning approval RR/2010/2485/P). The latest permission on the site (RR/2018/1696/P) reduces the net number of dwellings to 4, although the site is still capable of delivering 5 net dwellings and should therefore remain on the register.\"","resource":"971945b888f0a1073af5a74b9226d865fa156e338ab1dc28c6a69bf9a2e79619"},{"entry-date":"2019-10-01","organisation":"local-authority-eng:ROH","site":"RDCBLR0014","site-address":"45-47 Barnhorn Road, Bexhill","site-plan-url":"https://www.rother.gov.uk/CHttpHandler.ashx?id=32757","deliverable":"","ownership":"not owned by a public authority","planning-permission-status":"permissioned","planning-permission-type":"full planning permission","hazardous-substances":"","latitude":"50.84433","longitude":"0.427087","hectares":"0.06","minimum-net-dwellings":"6","maximum-net-dwellings":"6","start-date":"2017-10-01","end-date":"","notes":"\"This brownfield site is part of a larger site that includes greenfield land. The minimum net dwellings figure of 6 relates only to the brownfield part of this site, the whole site, including the greenfield part, has a permission for 8 dwellings (RR/2016/2430/P - Proposed demolition of two existing large dwelling houses and construction of eight 2 bedroom apartments and two 3 bedroom apartments across two blocks with associated parking and landscaping).\"","resource":"971945b888f0a1073af5a74b9226d865fa156e338ab1dc28c6a69bf9a2e79619"},{"entry-date":"2019-10-01","organisation":"local-authority-eng:ROH","site":"RDCBLR0015","site-address":"79-85 London Road-Rear of, Bexhill","site-plan-url":"https://www.rother.gov.uk/CHttpHandler.ashx?id=32758","deliverable":"yes","ownership":"not owned by a public authority","planning-permission-status":"permissioned","planning-permission-type":"full planning permission","hazardous-substances":"","latitude":"50.844099","longitude":"0.468925","hectares":"0.06","minimum-net-dwellings":"5","maximum-net-dwellings":"5","start-date":"2017-10-01","end-date":"","notes":"\"RR/2017/460/P - Redevelopment of site with terrace of 5 houses. A preliminary risk assessment based on a Site walkover survey and a desk study has indicated that the environmental risks associated with the site were low, and that a further intrusive site investigation was not required. This assessment is based on all materials currently stored on site being removed. The former stables are likely to contain droppings from pigeons and other vermin, which will present a health hazard to demolition workers, and must be removed in a controlled manner. Wooden doors and other items are probably coated with lead paint. Careful control of dust during demolition will be necessary. It is recommended that an asbestos survey of the buildings be conducted prior to demolition. On removal of the demolition rubble and existing floor slabs, it is recommended that the Site soils be inspected and photographed for signs of undetected on site contamination, particularly of oil spills.\"","resource":"971945b888f0a1073af5a74b9226d865fa156e338ab1dc28c6a69bf9a2e79619"},{"entry-date":"2019-10-01","organisation":"local-authority-eng:ROH","site":"RDCBLR0016","site-address":"Land at Moleynes Mead, Fryatts Way, Bexhill","site-plan-url":"https://www.rother.gov.uk/CHttpHandler.ashx?id=32759","deliverable":"yes","ownership":"not owned by a public authority","planning-permission-status":"pending decision","planning-permission-type":"","hazardous-substances":"","latitude":"50.852949","longitude":"0.451035","hectares":"0.42","minimum-net-dwellings":"13","maximum-net-dwellings":"13","start-date":"2017-10-01","end-date":"","notes":"This brownfield site is part of a larger site that includes greenfield land. The whole site, including the greenfield part, is allocated in the DaSA - proposed submission October 2018 - for some 24 dwellings, of which 30% are affordable. See Policy BEX7 of the DaSA (https://www.rother.gov.uk/CHttpHandler.ashx?id=32806&p=0). The site is subject to an outline planning application (reference RR/2017/2452/P) for 24 dwellings, which has delegated approval subject to conditions and the completion of a Section 106 agreement relating to the requirement for 30% affordable housing; the management of a wildlife area; and SuDS.\"","resource":"971945b888f0a1073af5a74b9226d865fa156e338ab1dc28c6a69bf9a2e79619"},{"entry-date":"2019-10-01","organisation":"local-authority-eng:ROH","site":"RDCBLR0017","site-address":"Land south of Terminus Road, Bexhill","site-plan-url":"https://www.rother.gov.uk/CHttpHandler.ashx?id=32760","deliverable":"yes","ownership":"mixed ownership","planning-permission-status":"permissioned","planning-permission-type":"outline planning permission","hazardous-substances":"","latitude":"50.840495","longitude":"0.467115","hectares":"0.15","minimum-net-dwellings":"10","maximum-net-dwellings":"10","start-date":"2017-10-01","end-date":"","notes":"\"This site is proposed to be allocated in the DaSA - proposed submission October 2018 for some 10 dwellings. Appropriate boundary landscaping will need to be provided and built development is restricted to the eastern part of the site resulting in an 8 metre built development exclusion zone from the main river culvert which passes along the western boundary. See Policy BEX8 of the DaSA (https://www.rother.gov.uk/CHttpHandler.ashx?id=32806&p=0). Site also benefits from outline permission RR/2018/2453/P.\"","resource":"971945b888f0a1073af5a74b9226d865fa156e338ab1dc28c6a69bf9a2e79619"},{"entry-date":"2019-10-01","organisation":"local-authority-eng:ROH","site":"RDCBLR0018","site-address":"Land at Michael Tyler Furniture, Woodlands Way, Hastings","site-plan-url":"https://www.rother.gov.uk/CHttpHandler.ashx?id=32761","deliverable":"yes","ownership":"not owned by a public authority","planning-permission-status":"pending decision","planning-permission-type":"","hazardous-substances":"","latitude":"50.885534","longitude":"0.576333","hectares":"0.99","minimum-net-dwellings":"40","maximum-net-dwellings":"40","start-date":"2017-10-01","end-date":"","notes":"\"This site is proposed to be allocated in the DaSA - proposed submission October 2018 - for some 40 dwellings, of which 30% are affordable. Suitable provision should be made for childrens play space in the form of a Local Area for Play (LAP). Development should not intrude into views from the Area of Outstanding Natural Beauty to the north. The tree belt on the west and north of the site should be strengthened. Parts of the site are located within areas that have surface water drainage issues and provision should be made for an acceptable connection to the local sewerage system in agreement with the service provider. The site may also contain Japanese Knotweed. See Policy HAS2 of the DaSA (https://www.rother.gov.uk/CHttpHandler.ashx?id=32806&p=0). Site permissioned subject to S106 under RR/2015/2264/P.\"","resource":"971945b888f0a1073af5a74b9226d865fa156e338ab1dc28c6a69bf9a2e79619"},{"entry-date":"2019-10-01","organisation":"local-authority-eng:ROH","site":"RDCBLR0019","site-address":"Land east of Hobbs Lane, Beckley Four Oaks","site-plan-url":"https://www.rother.gov.uk/CHttpHandler.ashx?id=32762","deliverable":"","ownership":"not owned by a public authority","planning-permission-status":"pending decision","planning-permission-type":"","hazardous-substances":"","latitude":"50.989446","longitude":"0.653338","hectares":"0.28","minimum-net-dwellings":"4","maximum-net-dwellings":"6","start-date":"2017-10-01","end-date":"","notes":"This brownfield site is part of a larger site that includes greenfield land. The part of the former business site that included landscaping has been excluded for the purposes of this register. The whole site, including the greenfield part, is proposed to be allocated in the DaSA - proposed submission October 2018 - for some 14 dwellings, of which 40% should be affordable. Access should be achieved off Hobbs Lane to the satisfaction of the Highways Authority. Screen tree and hedgerow planting employing native species should be provided on the eastern boundaries of the site. The tree belt on the northern boundary should be retained and enhanced with additional planting. A new footpath is provided to link the new development to the existing Hobbs Lane footway. A ground survey will need to be undertaken as part of any planning application. The former industrial use of part of the site could have led to ground contamination, and appropriate surveys will need to be undertaken as part of the planning application process, with the need to employ appropriate measures to mitigate any such contamination. Developers contributions should be made towards open space, specifically play provision for children and young people, in lieu of on-site provision. See Policy BEC1 of the DaSA (https://www.rother.gov.uk/CHttpHandler.ashx?id=32806&p=0).","resource":"971945b888f0a1073af5a74b9226d865fa156e338ab1dc28c6a69bf9a2e79619"},{"entry-date":"2019-10-01","organisation":"local-authority-eng:ROH","site":"RDCBLR0020","site-address":"Land at the Former Putting Green Site, Camber","site-plan-url":"https://www.rother.gov.uk/CHttpHandler.ashx?id=32763","deliverable":"","ownership":"owned by a public authority","planning-permission-status":"not permissioned","planning-permission-type":"","hazardous-substances":"","latitude":"50.934548","longitude":"0.79426","hectares":"0.2","minimum-net-dwellings":"10","maximum-net-dwellings":"10","start-date":"2017-10-01","end-date":"","notes":"\"This site is proposed to be allocated in the DaSA - proposed submission October 2018 - for some 10 dwellings, of which 40% are affordable. The site lies within Flood Zone 2. A Flood Risk Assessment would need to be submitted as part of any planning application to demonstrate that the development will be safe for its lifetime, taking account of the vulnerability of its users, without increasing flood risk elsewhere, and where possible, reduce flood risk overall. Residential development should not be provided on the ground floor due to flood risk but general living accommodation could be acceptable, subject to the FRA. The site is next to an SSSI. Development should not adversely affect the dunes. Built development should be focused on the southern section of the site to avoid overlooking and a reduction in light for the adjacent residential development to the north and west. A new footway alongside the sites southern boundary should be provided to link the new development to the existing Marchants Drive footway. The development should not adversely affect the integrity of the adjacent Natura 2000 Sites and should support the implementation of the Sustainable Access and Recreation Management Strategy (SARMS) as appropriate. See Policy CAM1 of the DaSA (https://www.rother.gov.uk/CHttpHandler.ashx?id=32806&p=0). Regard should also be given to the Councils adopted Camber Village Supplementary Planning Document (2014) (https://www.rother.gov.uk/CHttpHandler.ashx?id=27128&p=0).\"","resource":"971945b888f0a1073af5a74b9226d865fa156e338ab1dc28c6a69bf9a2e79619"},{"entry-date":"2019-10-01","organisation":"local-authority-eng:ROH","site":"RDCBLR0023","site-address":"Land at the Stonework Cottages, Rye Harbour","site-plan-url":"https://www.rother.gov.uk/CHttpHandler.ashx?id=32764","deliverable":"","ownership":"not owned by a public authority","planning-permission-status":"not permissioned","planning-permission-type":"","hazardous-substances":"","latitude":"50.938514","longitude":"0.758368","hectares":"1.59","minimum-net-dwellings":"40","maximum-net-dwellings":"40","start-date":"2017-10-01","end-date":"","notes":"\"The site is proposed to be allocated in the DaSA - proposed submission October 2018 - for some 40 dwellings, of which 30% are affordable. Access should be achieved off Harbour Road. Screening employing native species should be provided on the boundaries of the site. Appropriate fencing should be erected to maintain an effective barrier between the site and the adjacent Dungeness, Romney Marsh and Rye Bay SSSI, SPA and Ramsar Site. Development should not adversely impact upon the neighbouring Rye Harbour SSSI. The site lies within Flood Zone 3a so any scheme will be subject to both the sequential and exception tests. Habitable rooms should not be provided on the ground floor. Dwellings should be flood resilient/resistant. Furthermore, essential infrastructure should be designed and constructed to remain operational and safe in times of flood. Given the commercial history of the site there may be contamination in the ground. The water table is particularly shallow beneath the surface of the site (within 1-2 metres) and could be leeching of contaminants from other areas of the estate. A proposal would have to undertake a land contamination assessment with any planning application that demonstrated any risks could be managed appropriately through the re-development process. An appropriate foul and surface water drainage scheme should include surface water protection measures and where practicable, elements of SuDS, in accordance with Policy DEN5 in the DaSA Local Plan, whilst also taking into account of the high water table and the risk of contamination on the site. The development should not adversely affect the integrity of the adjacent Natura 2000 Sites and should support the implementation of the Sustainable Access and Recreation Management Strategy (SARMS) as appropriate. The development would need to respect the setting of the Grade II listed School House and Grade II Church of the Holy Spirits located west of the site. See Policy RHA1 of the DaSA (https://www.rother.gov.uk/CHttpHandler.ashx?id=32806&p=0).\"","resource":"971945b888f0a1073af5a74b9226d865fa156e338ab1dc28c6a69bf9a2e79619"},{"entry-date":"2019-10-01","organisation":"local-authority-eng:ROH","site":"RDCBLR0024","site-address":"Former Care Home, Moorhurst, A28, Westfield","site-plan-url":"https://www.rother.gov.uk/CHttpHandler.ashx?id=32765","deliverable":"","ownership":"owned by a public authority","planning-permission-status":"not permissioned","planning-permission-type":"","hazardous-substances":"","latitude":"50.915192","longitude":"0.580604","hectares":"0.22","minimum-net-dwellings":"10","maximum-net-dwellings":"10","start-date":"2017-10-01","end-date":"","notes":"This brownfield site is part of a larger site that includes greenfield land. The whole site, including the greenfield part, is proposed to be allocated in the DaSA - proposed submission October 2018 - for some 40 Retirement Living/Sheltered dwellings. Safe access to the A28 should be demonstrated, with preference to utilising the previously established access. Boundary trees and vegetation should be retained and enhanced with new native species landscape planting provided to fill in gaps. Communal gardens/amenity open space should be provided on-site to a minimum of 25sqm per dwelling unit. Provision should be made for an upgraded footway along the A28 connecting to the village core, together with safe means of accessing it from the site; an enhanced pedestrian link westwards along footpath 27 connecting to Cottage Lane; and a bus stop adjacent to the site. See Policy WES2 of the DaSA (https://www.rother.gov.uk/CHttpHandler.ashx?id=32806&p=0).","resource":"971945b888f0a1073af5a74b9226d865fa156e338ab1dc28c6a69bf9a2e79619"},{"entry-date":"2019-10-01","organisation":"local-authority-eng:ROH","site":"RDCBLR0025","site-address":"Land at Pestalozzi, Sedlescombe","site-plan-url":"https://www.rother.gov.uk/CHttpHandler.ashx?id=32766","deliverable":"","ownership":"not owned by a public authority","planning-permission-status":"not permissioned","planning-permission-type":"","hazardous-substances":"","latitude":"50.927799","longitude":"0.544299","hectares":"0.32","minimum-net-dwellings":"6","maximum-net-dwellings":"8","start-date":"2017-10-01","end-date":"2019-10-01","notes":"This brownfield site is part of a larger site that includes greenfield land. The whole site, including the greenfield part, is allocated in the Sedlescombe Neighbourhood Plan for some 6 - 8 dwellings. A scheme should make provision for 1 and 2 bed houses and flats, of no more than two storeys in height, a proportion  of which will be made available as affordable homes giving first preference to eligible employees or volunteers in perpetuity. It should include a viability appraisal that demonstrates the minimum number of open market dwellings required to cross-subsidise the refurbishment or replacement of the volunteers accommodation. It should incorporate a landscape scheme that mitigates any visual impact on the surrounding countryside. It should preserve the area of the site designated as Priority Habitat. It should comprise appropriate works to improve Ladybird Lane provided they do not include any additional lighting. It should identify and agree an alternative location for the estate management facility. It should demonstrate that any new access will have an acceptable impact on the character of the Brede Valley and demonstrated to be visually contained from public view points. See Policy 3 of the Sedlescombe Neighbourhood Plan (http://www.rother.gov.uk/Sedlescombe-Neighbourhood-Plan).","resource":"971945b888f0a1073af5a74b9226d865fa156e338ab1dc28c6a69bf9a2e79619"},{"entry-date":"2019-10-01","organisation":"local-authority-eng:ROH","site":"RDCBLR0026","site-address":"Land at Sedlescombe Sawmills, Sedlescombe","site-plan-url":"https://www.rother.gov.uk/CHttpHandler.ashx?id=32767","deliverable":"","ownership":"not owned by a public authority","planning-permission-status":"not permissioned","planning-permission-type":"","hazardous-substances":"","latitude":"50.955064","longitude":"0.527547","hectares":"0.51","minimum-net-dwellings":"6","maximum-net-dwellings":"8","start-date":"2017-10-01","end-date":"","notes":"This brownfield site is part of a larger site that includes greenfield land. The whole site, including the greenfield part, is allocated in the Sedlescombe Neighbourhood Plan. Any proposals should make provision for an employment scheme, comprising the reuse and/or redevelopment of existing buildings for employment purposes increasing the square footage from 9,250 to approx. 12,000 sq. ft. provided the employment scheme is completed and available for occupation prior to the final occupation of the housing scheme. It should preserve the area of the site designated as Priority Habitat. It should make provision for a residential scheme, comprising only open market dwellings, provided; the number of dwellings is assessed to be the minimum required to cross-subsidise the employment scheme, based on a submitted viability appraisal; the design of all the dwellings makes sufficient provision for dedicated office and/or workshop space for the benefit of the occupants; makes provision for a holiday accommodation scheme; and includes the demolition of existing buildings and structures that detract from the scenic beauty of the adjoining landscape. See Policy 5 of the Sedlescombe Neighbourhood Plan (http://www.rother.gov.uk/Sedlescombe-Neighbourhood-Plan).\"","resource":"971945b888f0a1073af5a74b9226d865fa156e338ab1dc28c6a69bf9a2e79619"},{"entry-date":"2019-10-01","organisation":"local-authority-eng:ROH","site":"RDCBLR0027","site-address":"Mill Site, Robertsbridge","site-plan-url":"https://www.rother.gov.uk/CHttpHandler.ashx?id=32768","deliverable":"yes","ownership":"not owned by a public authority","planning-permission-status":"pending decision","planning-permission-type":"","hazardous-substances":"","latitude":"50.990415","longitude":"0.474004","hectares":"2.17","minimum-net-dwellings":"54","maximum-net-dwellings":"87","start-date":"2017-10-01","end-date":"","notes":"This brownfield site is part of a larger site that includes greenfield land. The whole site, including the greenfield part, is allocated in the Salehurst & Robertsbridge Neighbourhood Plan. Estimates of the housing capacities of the sites have varied; those in the submission Neighbourhood Plan and those of the Local Authority gave figures ranging from 85-100 dwellings.  The Examiner found that the capacities of each site allocation in the Neighbourhood Plan were presently uncertain and that they will be a reflection of the size and mix of units within any planning application, having due regard to Local Plan and Neighbourhood Plan policies. Policy HO2 of the Neighbourhood Plan allocates at least 1,200sqm of employment floorspace including 280sqm of Class A3 uses and 920sqm of B1 uses. A scheme will be subject to both the sequential and exception tests given the location of part of the site in the flood zone. The site is also affected by some surface water flooding. Due to the flooding issues, a safe access will need to be provided to the A21 that is useable during a flood event. The site is partially located within the Conservation Area and Public Rights of Way pass through the site. See Policy HO2 of the Salehurst and Robertsbridge Neighbourhood Plan (http://www.rother.gov.uk/Salehurst-and-Robertsbridge-Neighbourhood-Plan).","resource":"971945b888f0a1073af5a74b9226d865fa156e338ab1dc28c6a69bf9a2e79619"},{"entry-date":"2019-10-01","organisation":"local-authority-eng:ROH","site":"RDCBLR0028","site-address":"Tilling Green, Rye","site-plan-url":"https://www.rother.gov.uk/CHttpHandler.ashx?id=32769","deliverable":"","ownership":"owned by a public authority","planning-permission-status":"not permissioned","planning-permission-type":"","hazardous-substances":"","latitude":"50.951835","longitude":"0.722362","hectares":"0.26","minimum-net-dwellings":"7","maximum-net-dwellings":"8","start-date":"2017-10-01","end-date":"","notes":"\"This site is allocated in the Rye Neighbourhood Plan (adopted July 2019) for at least 20 dwellings and a replacement community centre (up to 500 sqm), with up to 10% being self/custom build subject to a number of criteria, for instance the design of new development shall be sympathetic to the building form and materials used in surrounding buildings and provide appropriate external amenity areas for both the dwellings and the community centre; the community centre is to be retained in-situ or replaced before the last dwelling is occupied and a flood risk assessment shall be demonstrating that the residential development is safe for its lifetime; lastly car parking should be provided according to appropriate standards. See Policy H3 of the Rye Neighbourhood Plan (http://www.rother.gov.uk/CHttpHandler.ashx?id=31997&p=0).\"","resource":"971945b888f0a1073af5a74b9226d865fa156e338ab1dc28c6a69bf9a2e79619"},{"entry-date":"2019-10-01","organisation":"local-authority-eng:ROH","site":"RDCBLR0029","site-address":"Freda Gardham School site, Rye","site-plan-url":"https://www.rother.gov.uk/CHttpHandler.ashx?id=32770","deliverable":"","ownership":"owned by a public authority","planning-permission-status":"not permissioned","planning-permission-type":"","hazardous-substances":"","latitude":"50.953073","longitude":"0.741302","hectares":"0.72","minimum-net-dwellings":"18","maximum-net-dwellings":"22","start-date":"2017-10-01","end-date":"","notes":"\"This site is allocated in the Rye Neighbourhood Plan (adopted July 2019) for at least 30 dwellings, at least 10% of which will be self/custom build subject to a number criteria such as access, flood risk assessment that demonstrate that the residential development it is safe for its lifetime; the development shall include appropriate treatment to the south and west boundaries to protect the countryside and habitats beyond; and no development can commence until the flood mitigation works by the EA for the eastern bank of the River Rother have been fully implemented; furthermore the layout should ensure access to the existing sewerage infrastructure for maintenance and upsizing purposes. See Policy H7 of the Rye Neighbourhood Plan (http://www.rother.gov.uk/CHttpHandler.ashx?id=31997&p=0).\"","resource":"971945b888f0a1073af5a74b9226d865fa156e338ab1dc28c6a69bf9a2e79619"},{"entry-date":"2019-10-01","organisation":"local-authority-eng:ROH","site":"RDCBLR0030","site-address":"Former High School Site and Drill Halls, Down Road, Bexhill","site-plan-url":"https://www.rother.gov.uk/CHttpHandler.ashx?id=32771","deliverable":"","ownership":"mixed ownership","planning-permission-status":"pending decision","planning-permission-type":"outline planning permission","hazardous-substances":"","latitude":"50.846995","longitude":"0.467231","hectares":"2.18","minimum-net-dwellings":"35","maximum-net-dwellings":"54","start-date":"2017-10-01","end-date":"","notes":"This brownfield site is part of a larger site that includes a small element of greenfield land. The whole site, including the greenfield part, is allocated in the DaSA - Proposed submission October 2018 - for either some 35 houses or some 36 flats and 18 houses. In both cases, 30% of the dwelling units shall be affordable. Any proposals should include: a high quality wet and dry sports and leisure facility of up to 6,500sqm; a complementary commercial development, including up to a 100 bed hotel, plus up to 4 units of restaurant space totalling around 400sqm; car-parking to serve the development, along with associated car/coach parking and drop-off area for the adjacent school; and provision for the retention and enhancement of boundary planting on the northern boundary. If required, the current users of the Drill Hall have been provided for at an alternative location. Development of the site should be through a comprehensive masterplan and should focus on an accessible, sustainable and high quality leisure hub facility, creating a landmark leisure destination through high quality buildings and public realm on this highly prominent gateway site into the town. See Policy BEX4 of the DaSA (https://www.rother.gov.uk/CHttpHandler.ashx?id=32806&p=0). There is an current outline planning application RR/2019/430/P, for the site, inclduing the greenfield element, which is currently undetermined, for up to 52 dwellings and mixed use leisure centre. It is proposed in the DaSA - proposed submission October 2018 - that this site provides a high quality wet and dry sports and leisure facility of around 6,500sqm, as well as a complementary commercial development, including up to a 100 bed hotel, plus up to 4 units of restaurant totalling around 400sqm. Car-parking should also be provided to serve the development, including electric charging points, along with associated car/coach parking and drop-off area for the adjacent school.\"","resource":"971945b888f0a1073af5a74b9226d865fa156e338ab1dc28c6a69bf9a2e79619"},{"entry-date":"2019-10-01","organisation":"local-authority-eng:ROH","site":"RDCBLR0031","site-address":"St Andrew's Church, Wickham Avenue, Bexhill","site-plan-url":"https://www.rother.gov.uk/CHttpHandler.ashx?id=32772","deliverable":"yes","ownership":"not owned by a public authority","planning-permission-status":"permissioned","planning-permission-type":"full planning permission","hazardous-substances":"","latitude":"50.840051","longitude":"0.468115","hectares":"0.08","minimum-net-dwellings":"11","maximum-net-dwellings":"11","start-date":"2018-10-01","end-date":"2019-01-01","notes":"\"RR/2018/273/P - Conversion of redundant church building into 11 flats including external alterations and erection of bin store and bike/external store building.\"","resource":"971945b888f0a1073af5a74b9226d865fa156e338ab1dc28c6a69bf9a2e79619"},{"entry-date":"2019-10-01","organisation":"local-authority-eng:ROH","site":"RDCBLR0032","site-address":"Oliver's Printers, Eastwood Road, Bexhill","site-plan-url":"https://www.rother.gov.uk/CHttpHandler.ashx?id=32773","deliverable":"yes","ownership":"not owned by a public authority","planning-permission-status":"permissioned","planning-permission-type":"outline planning permission","hazardous-substances":"","latitude":"50.845419","longitude":"0.461821","hectares":"0.24","minimum-net-dwellings":"13","maximum-net-dwellings":"13","start-date":"2018-10-01","end-date":"2019-05-01","notes":"\"RR/2018/2052/P - Demolition of existing building and erection of 13 dwellings comprising 11 x 2 bedroom houses and 2 x 3 bedroom houses together with parking and access.\"","resource":"971945b888f0a1073af5a74b9226d865fa156e338ab1dc28c6a69bf9a2e79619"},{"entry-date":"2019-10-01","organisation":"local-authority-eng:ROH","site":"RDCBLR0033","site-address":"58-60 Devonshire Road, Bexhill","site-plan-url":"https://www.rother.gov.uk/CHttpHandler.ashx?id=32774","deliverable":"yes","ownership":"not owned by a public authority","planning-permission-status":"permissioned","planning-permission-type":"full planning permission","hazardous-substances":"","latitude":"50.838244","longitude":"0.473616","hectares":"0.03","minimum-net-dwellings":"6","maximum-net-dwellings":"6","start-date":"2018-10-01","end-date":"2019-06-13","notes":"\"RR/2017/2122/P - Conversion of upper floors to 6 self-contained flats.\"","resource":"971945b888f0a1073af5a74b9226d865fa156e338ab1dc28c6a69bf9a2e79619"},{"entry-date":"2019-10-01","organisation":"local-authority-eng:ROH","site":"RDCBLR0034","site-address":"128 Dorset Road, Bexhill","site-plan-url":"https://www.rother.gov.uk/CHttpHandler.ashx?id=32775","deliverable":"yes","ownership":"not owned by a public authority","planning-permission-status":"permissioned","planning-permission-type":"full planning permission","hazardous-substances":"","latitude":"50.846815","longitude":"0.488844","hectares":"0.11","minimum-net-dwellings":"14","maximum-net-dwellings":"14","start-date":"2018-10-01","end-date":"2018-07-01","notes":"This brownfield site is part of a larger site that includes greenfield land. The whole site, including the greenfield part, has permission for 14 dwellings (RR/2018/13/P - Change of use from care home to 14no. flats together with parking, removal of external means of escape, provision of two rear dormers and altered/additional windows).\"","resource":"971945b888f0a1073af5a74b9226d865fa156e338ab1dc28c6a69bf9a2e79619"},{"entry-date":"2019-10-01","organisation":"local-authority-eng:ROH","site":"RDCBLR0035","site-address":"124 Dorset Road, Bexhill","site-plan-url":"https://www.rother.gov.uk/CHttpHandler.ashx?id=32776","deliverable":"yes","ownership":"not owned by a public authority","planning-permission-status":"permissioned","planning-permission-type":"full planning permission","hazardous-substances":"","latitude":"50.846668","longitude":"0.488154","hectares":"0.07","minimum-net-dwellings":"13","maximum-net-dwellings":"13","start-date":"2018-10-01","end-date":"2019-01-01","notes":"This brownfield site is part of a larger site that includes greenfield land. The whole site, including the greenfield part, has permission for 13 dwellings (RR/2018/14/P - Change of use from care home to 13no. flats together with parking, partial removal of bay on the east (side) elevation and minor external alterations).\"","resource":"971945b888f0a1073af5a74b9226d865fa156e338ab1dc28c6a69bf9a2e79619"},{"entry-date":"2019-10-01","organisation":"local-authority-eng:ROH","site":"RDCBLR0036","site-address":"Skinners of Rye, Rye","site-plan-url":"https://www.rother.gov.uk/CHttpHandler.ashx?id=32777","deliverable":"yes","ownership":"mixed ownership","planning-permission-status":"permissioned","planning-permission-type":"full planning permission","hazardous-substances":"","latitude":"50.953089","longitude":"0.736035","hectares":"0.05","minimum-net-dwellings":"6","maximum-net-dwellings":"6","start-date":"2018-10-01","end-date":"","notes":"\"Demolition of existing workshop. Erection of 4 new units with commercial use on the ground floor and residential on upper storeys. Refurbishment of existing three storey commercial unit, approximately 159 sqm; creation of two new apartments on the first and second floors. Provision or 6 parking spaces and retention of one of the existing vehicle accesses to the site. The site includes an area of the car park to the east which is subject to a lease agreement with Rother District Council. This area would be retained for car parking. The area has been excluded from the site as it is not suitable for residential development. The former use as a motor vehicle repair workshop could have led to contamination of the ground/ground water due to the use of oils, solvents and other chemicals. A contaminated land assessment along with an associated remedial strategy has been conditioned under RR/2017/909/P.\"","resource":"971945b888f0a1073af5a74b9226d865fa156e338ab1dc28c6a69bf9a2e79619"},{"entry-date":"2019-10-01","organisation":"local-authority-eng:ROH","site":"RDCBLR0037","site-address":"The Warren Yard, Catsfield","site-plan-url":"https://www.rother.gov.uk/CHttpHandler.ashx?id=32778","deliverable":"yes","ownership":"not owned by a public authority","planning-permission-status":"permissioned","planning-permission-type":"full planning permission","hazardous-substances":"","latitude":"50.907326","longitude":"0.44638","hectares":"1.21","minimum-net-dwellings":"6","maximum-net-dwellings":"6","start-date":"2018-10-01","end-date":"","notes":"\"This site was previously split into two areas - the eastern side was proposed for housing and the western side was proposed for commercial development. Each area was subject to separate planning applications but both sites were linked by a S106 agreement. A new permission, reference number RR/2018/1309/P (Revised scheme for the redevelopment of the site to provide a new office building with associated parking and 6 No. houses) has since been granted. This permission combines the previous two separate applications. Under this revised permission, the residential part is proposed to the western side and commercial to the eastern side. It should be noted that the residential development is only acceptable as it is enabling development for the redevelopment of the existing commercial use of the wider site.\"","resource":"971945b888f0a1073af5a74b9226d865fa156e338ab1dc28c6a69bf9a2e79619"},{"entry-date":"2019-10-01","organisation":"local-authority-eng:ROH","site":"RDCBLR0038","site-address":"Land at Northeye (Former UAE Technical Training Project), Bexhill","site-plan-url":"https://www.rother.gov.uk/CHttpHandler.ashx?id=32779","deliverable":"","ownership":"not owned by a public authority","planning-permission-status":"not permissioned","planning-permission-type":"","hazardous-substances":"","latitude":"50.84836","longitude":"0.4084","hectares":"6.36","minimum-net-dwellings":"140","maximum-net-dwellings":"140","start-date":"2018-10-01","end-date":"","notes":"\"This brownfield site is part of a larger site that includes greenfield land. The site is proposed to be allocated in the DaSA - proposed submission October 2018 - for some 140 dwellings, of which 30% should be provided as affordable housing.  A full size adult football pitch and/or a senior cricket pitch should be provided on the northern part of the site, alongside associated ancillary changing and parking facilities to serve the playing pitch. Highway access should be provided from Wartling Drive and Principal Close, via Coneyburrow Lane, alongside offsite highway works to make the development acceptable in highway terms. In accordance with policy DEN5 Sustainable Drainage at least two forms of appropriate SuDS should be incorporated and an Appropriate Assessment under the Habitat Regulations demonstrates beyond reasonable scientific doubt that these can be delivered on the site and that the development can otherwise proceed, with mitigation if necessary, without harming the integrity of the adjacent Pevensey Levels Special Area of Conservation/Ramsar site. Flood zone 3 should be kept free from development. Suitable provision should be made for childrens play space in the form of both a Locally Equipped Area for Play (LEAP) and a Local Area for Play (LAP). The Public Right of Way (PROW) should be reinstated through the middle of the site, following the stream corridor together with a financial contribution towards improvements to the existing PROW network in the locality. A travel plan is included to promote the use of alternative travel choices other than the private car, including off-site measures to support cycling and walking and other sustainable transport modes to encourage the use of public transport, car sharing and electric, low and ultra-low emission vehicles in compliance with Core Strategy Policy TR3. Improvements should also be made to existing local bus stop infrastructure and a financial contribution towards improving local bus services is provided. Provision should be made for the retention and enhancement of existing landscape buffers with locally characteristic native tree and shrub planting, particularly on the western and northern boundaries. A connection should be provided to the local sewerage system at the nearest point of adequate capacity, in collaboration with the service provider. Development of the site should be through a Green Infrastructure framework and landscape led masterplan. See Policy BEX10 of the DaSA (https://www.rother.gov.uk/CHttpHandler.ashx?id=32806&p=0).\"","resource":"971945b888f0a1073af5a74b9226d865fa156e338ab1dc28c6a69bf9a2e79619"},{"entry-date":"2019-10-01","organisation":"local-authority-eng:ROH","site":"RDCBLR0039","site-address":"Land adj Rainbow Trout, Chitcombe Road, Broad Oak","site-plan-url":"https://www.rother.gov.uk/CHttpHandler.ashx?id=32780","deliverable":"","ownership":"not owned by a public authority","planning-permission-status":"pending decision","planning-permission-type":"full planning permission","hazardous-substances":"","latitude":"50.94867","longitude":"0.597166","hectares":"0.25","minimum-net-dwellings":"8","maximum-net-dwellings":"8","start-date":"2019-10-01","end-date":"","notes":"This brownfield site is part of a larger site that includes greenfield land. The whole site, including the greenfield part, is proposed to be allocated in the DaSA - proposed submission October 2018 - for a comprehensive scheme comprising a public house and residential development of some 20 dwellings of which 40% are affordable. Any proposal for development would need to retain the public house currently on site and a new vehicular and pedestrian access would need to be achieved on site together with appropriate boundary treatment. See Policy BRO2 of the DaSA (https://www.rother.gov.uk/CHttpHandler.ashx?id=32806&p=0). This brownfield site is subject to a current planning applications which is currently undetermined (RR/2018/1813/P) for the development of 8 dwellings.\"","resource":"971945b888f0a1073af5a74b9226d865fa156e338ab1dc28c6a69bf9a2e79619"},{"entry-date":"2019-10-01","organisation":"local-authority-eng:ROH","site":"RDCBLR0040","site-address":"48 Ferry Road, Rye","site-plan-url":"https://www.rother.gov.uk/CHttpHandler.ashx?id=32781","deliverable":"yes","ownership":"not owned by a public authority","planning-permission-status":"permissioned","planning-permission-type":"full planning permission","hazardous-substances":"","latitude":"50.951219","longitude":"0.729076","hectares":"0.03","minimum-net-dwellings":"7","maximum-net-dwellings":"7","start-date":"2019-10-01","end-date":"","notes":"\"RR/2018/1828/P - Change of use of night club and private members club to residential use with parking and A3 use on the ground floor.\"","resource":"971945b888f0a1073af5a74b9226d865fa156e338ab1dc28c6a69bf9a2e79619"},{"entry-date":"2019-10-01","organisation":"local-authority-eng:ROH","site":"RDCBLR0041","site-address":"8 Chandler Road, Bexhill","site-plan-url":"https://www.rother.gov.uk/CHttpHandler.ashx?id=32786","deliverable":"","ownership":"not owned by a public authority","planning-permission-status":"not permissioned","planning-permission-type":"","hazardous-substances":"","latitude":"50.845711","longitude":"0.460316","hectares":"0.1","minimum-net-dwellings":"5","maximum-net-dwellings":"5","start-date":"2019-10-01","end-date":"","notes":"\"Application RR/2019/487/P for the proposed demolition of the existing commercial factory and construction of five new houses was withdrawn by the applicant following concerns raised by the LPA in relation to inadequate information submitted in relation to parking and access and for the overall bulk of the proposed building. The site is however considered capable of delivering some 5 or more dwellings in the form of a flatted development.\"","resource":"971945b888f0a1073af5a74b9226d865fa156e338ab1dc28c6a69bf9a2e79619"},{"entry-date":"2019-10-01","organisation":"local-authority-eng:ROH","site":"RDCBLR0042","site-address":"17-19 Tower Street, Rye","site-plan-url":"https://www.rother.gov.uk/CHttpHandler.ashx?id=32787","deliverable":"yes","ownership":"not owned by a public authority","planning-permission-status":"permissioned","planning-permission-type":"full planning permission","hazardous-substances":"","latitude":"50.953027","longitude":"0.734436","hectares":"0.12","minimum-net-dwellings":"6","maximum-net-dwellings":"6","start-date":"2019-10-01","end-date":"","notes":"\"RR/2017/2217/P - Refurbishment of existing units. Change of use of 6 units from commercial to residential. Change of use of former stable block to offices and/or shops. Minor landscaping works to the courtyard.\"","resource":"971945b888f0a1073af5a74b9226d865fa156e338ab1dc28c6a69bf9a2e79619"},{"entry-date":"2019-10-01","organisation":"local-authority-eng:ROH","site":"RDCBLR0043","site-address":"Bridge Point, Rock Channel, Rye","site-plan-url":"https://www.rother.gov.uk/CHttpHandler.ashx?id=32788","deliverable":"","ownership":"not owned by a public authority","planning-permission-status":"pending decision","planning-permission-type":"full planning permission","hazardous-substances":"","latitude":"50.947577","longitude":"0.732137","hectares":"1.04","minimum-net-dwellings":"11","maximum-net-dwellings":"11","start-date":"2019-10-01","end-date":"","notes":"\"This site is part of a larger site which has been allocated in the Rye Neighbourhood Plan (adopted July 2019) for at least 30 dwellings. In this site the design of any proposed scheme shall be innovative, of high architectural quality to enhance setting against the Rye Conservation Area and having regard to its riverside location, with green spaces, improved and accessible riverside walks; the site access should be via the existing track; a site specific flood risk assessment should demonstrate that the development it is safe for its lifetime; furthermore development in this site shall be designed so that if it is developed in phases, the form of the development does not prejudice the redevelopment of adjacent land; lastly occupation of the development should be phased to align with the delivery of sewerage infrastructure. See Policy H4 of the Rye Neighbourhood Plan (http://www.rother.gov.uk/CHttpHandler.ashx?id=31997&p=0). A full planning application for a mixed use development is currently under consideration on this site. RR/2019/789/P - Conversion of existing redundant warehouse into a new multi-purpose arts centre, to include workshops, gallery space, mixed use art space and rehearsal space with 3 x live/work artist accommodation units above. Demolition of existing river cafe building with new two storey replacement riverside restaurant and single holiday let accommodation. Construction of 5 new riverside dwellings along with partial demolition of the eastern part of the existing warehouse building and part conversion to form 3 new mews dwellings together with the creation of a new public park and riverside walkway, re-positioning of existing private road and works to include parking, vehicular access improvements and landscaping.\"","resource":"971945b888f0a1073af5a74b9226d865fa156e338ab1dc28c6a69bf9a2e79619"},{"entry-date":"2019-10-01","organisation":"local-authority-eng:ROH","site":"RDCBLR0044","site-address":"Rock Channel, Rye","site-plan-url":"https://www.rother.gov.uk/CHttpHandler.ashx?id=32789","deliverable":"","ownership":"not owned by a public authority","planning-permission-status":"not permissioned","planning-permission-type":"","hazardous-substances":"","latitude":"50.948173","longitude":"0.732798","hectares":"1.18","minimum-net-dwellings":"19","maximum-net-dwellings":"19","start-date":"2019-10-01","end-date":"","notes":"\"This site is part of a larger site which has been allocated in the Rye Neighbourhood Plan (adopted July 2019) for 30 dwellings. The adopted policy in the Neighbourhood Plan for the entire site, including the greenfield part, sets out that the design of any scheme shall be innovative, of high architectural quality to enhance setting against the Rye Conservation Area and having regard to its riverside location, with green spaces, improved and accessible riverside walks; the site access should be via the existing track; a site specific flood risk assessment should demonstrate that the development it is safe for its lifetime; furthermore development in this site shall be designed so that if it is developed in phases, the form of the development does not prejudice the redevelopment of adjacent land; lastly occupation of the development should be phased to align with the delivery of sewerage infrastructure. See Policy H4 of the Rye Neighbourhood Plan (http://www.rother.gov.uk/CHttpHandler.ashx?id=31997&p=0). There is a current application, inclduding the greenfield part (RR/2019/789/P), which is currently undetermined. It is estimated that the brownfield element of the site subject to that undetermined applcaition could deliver at least 19 dwellings.\"","resource":"971945b888f0a1073af5a74b9226d865fa156e338ab1dc28c6a69bf9a2e79619"},{"entry-date":"2019-10-01","organisation":"local-authority-eng:ROH","site":"RDCBLR0045","site-address":"Winchelsea Road (East Side), Rye","site-plan-url":"https://www.rother.gov.uk/CHttpHandler.ashx?id=32790","deliverable":"","ownership":"not owned by a public authority","planning-permission-status":"not permissioned","planning-permission-type":"","hazardous-substances":"","latitude":"50.948125","longitude":"0.730603","hectares":"1.71","minimum-net-dwellings":"10","maximum-net-dwellings":"10","start-date":"2019-10-01","end-date":"","notes":"\"This site is allocated in the Rye Neighbourhood Plan (adopted July 2019) for mixed-use, including at least 10 dwellings, car parking or B1 employment. Development in this site shall be designed so that if it is developed in phases, the form of the development does not prejudice the redevelopment of adjacent land; the design shall be of high architectural quality having regard to Rye Conservation Area; there should be provision of riverside green spaces and access for the England South East Coastal Path; Any scheme shall enable views from the south to the cliff face maximising visual permeability, and with roof heights set not to obstruct longer views from the countryside towards the Citadel; A site specific flood risk assessment should demonstrate that the residential development is safe for the lifetime of the development incorporating appropriate flood resilient and resistant measures including safe access and escape routes where required. See Policy H5 of the Rye Neighbourhood Plan (http://www.rother.gov.uk/CHttpHandler.ashx?id=31997&p=0).\"","resource":"971945b888f0a1073af5a74b9226d865fa156e338ab1dc28c6a69bf9a2e79619"},{"entry-date":"2019-10-01","organisation":"local-authority-eng:ROH","site":"RDCBLR0046","site-address":"Winchelsea Road (West Side), Rye","site-plan-url":"https://www.rother.gov.uk/CHttpHandler.ashx?id=32791","deliverable":"","ownership":"not owned by a public authority","planning-permission-status":"not permissioned","planning-permission-type":"","hazardous-substances":"","latitude":"50.948157","longitude":"0.728839","hectares":"1.49","minimum-net-dwellings":"20","maximum-net-dwellings":"20","start-date":"2019-10-01","end-date":"","notes":"\"This site is allocated in the Rye Neighbourhood Plan (adopted July 2019) for mixed-use, including at least 20 dwellings and B1 employment. Development in this site shall be designed so that if it is developed in phases, the form of the development does not prejudice the redevelopment of adjacent land; the design shall create a strong sense of place and buildings should be orientated to allow views through to the marsh to the south-west; A site specific flood risk assessment should demonstrate that the residential development is safe for the lifetime of the development incorporating appropriate flood resilient and resistant measures including safe access and escape routes where required; occupation of the development should be phased to align with the delivery of sewerage infrastructure. See Policy H6 of the Rye Neighbourhood Plan (http://www.rother.gov.uk/CHttpHandler.ashx?id=31997&p=0).\"","resource":"971945b888f0a1073af5a74b9226d865fa156e338ab1dc28c6a69bf9a2e79619"},{"entry-date":"2019-10-01","organisation":"local-authority-eng:ROH","site":"RDCBLR0047","site-address":"Former Thomas Peacocke School Site, Rye","site-plan-url":"https://www.rother.gov.uk/CHttpHandler.ashx?id=32792","deliverable":"","ownership":"not owned by a public authority","planning-permission-status":"pending decision","planning-permission-type":"full planning permission","hazardous-substances":"","latitude":"50.952265","longitude":"0.728596","hectares":"0.76","minimum-net-dwellings":"35","maximum-net-dwellings":"38","start-date":"2019-10-01","end-date":"","notes":"\"This brownfield site is part of a larger site that includes greenfield land. The whole site, including the greenfield part, is allocated in the Rye Neighbourhood Plan (adopted July 2019) for at least 50 dwellings. A site specific flood risk assessment should demonstrate that the residential development is safe for the lifetime of the development incorporating appropriate flood resilient and resistant measures including safe access and escape routes where required; Any development should be designed to avoid any damage to the belt of trees adjacent to the railway which is protected by Tree Preservation Order; Access for any scheme shall be carefully designed to be safe, accessible for pedestrians and cyclists as well as vehicles and avoid conflict with the nearby level crossing of the railway; parking provision on the site should be in accordance with local standards and the occupation of the development shall be phased to align with the delivery of sewerage infrastructure. See Policy H8 of the Rye Neighbourhood Plan (http://www.rother.gov.uk/CHttpHandler.ashx?id=31997&p=0). There is a current application for the whole site, including the greenfield part (RR/2017/1778/P) for a residential development of 63 units, which is currently undetermined.\"","resource":"971945b888f0a1073af5a74b9226d865fa156e338ab1dc28c6a69bf9a2e79619"},{"entry-date":"2019-10-01","organisation":"local-authority-eng:ROH","site":"RDCBLR0048","site-address":"Land adjacent to the Station Car Park, Crowhurst","site-plan-url":"https://www.rother.gov.uk/CHttpHandler.ashx?id=32793","deliverable":"","ownership":"not owned by a public authority","planning-permission-status":"not permissioned","planning-permission-type":"","hazardous-substances":"","latitude":"50.888209","longitude":"0.501729","hectares":"0.08","minimum-net-dwellings":"6","maximum-net-dwellings":"6","start-date":"2019-10-01","end-date":"","notes":"\"This site is allocated in the Crowhurst Neighbourhood Plan (adopted July 2019) for 6 dwellings and it should provide affordable housing in accordance with the relevant policies. The development shall have regard to the High Weald AONB and it should be supported by a tree survey; it shall comprise 1 or 2 bedroom units in the form of flats or apartments, any building should be of a traditional architectural vernacular and shall not exceed 2 storeys; access and parking shall be safe and adequate for both current residents and future occupiers. See Policy CH3 of the Crowhurst Neighbourhood Plan (http://www.rother.gov.uk/CHttpHandler.ashx?id=31999&p=0).\"","resource":"971945b888f0a1073af5a74b9226d865fa156e338ab1dc28c6a69bf9a2e79619"}]
